        public static SigilStone_Mask<bool> GetEqualsMask(
            this ISigilStoneGetter item,
            ISigilStoneGetter rhs)
        {
            var ret = new SigilStone_Mask<bool>();
            FillEqualsMask(item, rhs, ret);
